('2344','2','8345','Maria Pila Gomez',Null,'Großzügige Dublexwohnung mit Hafenblick, Palma de Mallorca','33035','Nur wenige Gehminuten vom Einkaufszentrum Porto Pi in Palma de Mallorca entfernt, befindet sich dieses geräumige Penthouse-Dublex-Apartment. Auf der unteren Ebene der Wohnung befindet sich der Eingang mit Diele, Wohn-Esszimmer, Terrasse, große Küche mit Hauswirtschaftsraum und Abstellraum, 1 Gästeschlafzimmer mit Bad en suite und ein Gäste WC. In der oberen Etage hat es eine Galerie, 2 Schlafzimmer mit je einem Badezimmer en suite, sowie das Hauptschlafzimmer mit Badezimmer und einer Terrasse. Zur gepflegten Ausstattung gehören Marmor Fußböden, Parkettboden in den Schlafzimmern, Gas Zentralheizung, Klimaanlage, Alu- Doppelglasfenster und eine Einbauküche mit Esstisch. Bequemes Parken in der Tiefgarage mit eigenem Abstellplatz ist möglich. \r\nVor dem Apartmentgebäude liegt der Gemeinschaftsgarten mit Pool und Zugang zu einem kleinen Sportboothafen. Liegeplätze für kleinere Sportboote sind sehr gefragt. Der Verkäufer würde sein Boot, eine Sunseeker Monte Rey 27 (7,90m lang) 2 Volvo Motoren Gasolin,  für 18.500€ verkaufen. Der Liegeplatz kann von der Stadt Palma für ca 650€ / Jahr dazugemietet werden. \r\n','33036','1350000','106','2015-06-22 13:29:15','106','2015-06-22 13:30:43',Null,'2415','106','1136',1,'1','0',Null,Null,Null,'33037',Null,'0','0','0',Null,'2015-06-22 13:37:21',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33038',Null,'33039',Null,'33040',Null,'33041','699 618 319','33042','0',0,'4');
